import React from 'react';
import Tilt from 'react-parallax-tilt';
import brain from '../../images/brain-logo.png'

const Logo = () => {
    return (
            <Tilt className='Tilt br2 shadow-2' options={{ max:55, scale: 2, transitionSpeed: 2000 }} style={{ height:150, width:'fitc' }}>
                <img className='brainLogo' alt='logo' src={brain} />
            </Tilt>
    )
}

export default Logo
